import PropTypes from "prop-types";
import { useState } from "react";
import { Link as RouterLink } from "react-router-dom";

// material-ui
import {
  Box,
  Link,
  Stack,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Typography,
} from "@mui/material";

// third-party

// project import
import Dot from "../../Components/Dot";

function createData(userId, Bid, time) {
  return { userId, Bid, time };
}

const rows = [
  createData(84564564, "Camera Lens", 2),
  createData(98764564, "Laptop", 0),
  createData(98756325, "Mobile", 1),
  createData(98652366, "Handset", 1),
  createData(13286564, "Computer Accessories", 1),
  createData(86739658, "TV", 0),
  createData(13256498, "Keyboard", 2),
  createData(98753263, "Mouse", 2),
  createData(98753275, "Desktop", 1),
  createData(98753291, "Chair", 0),
];

function descendingComparator(a, b, orderBy) {
  if (b[orderBy] < a[orderBy]) {
    return -1;
  }
  if (b[orderBy] > a[orderBy]) {
    return 1;
  }
  return 0;
}

function getComparator(order, orderBy) {
  return order === "desc"
    ? (a, b) => descendingComparator(a, b, orderBy)
    : (a, b) => -descendingComparator(a, b, orderBy);
}

function stableSort(array, comparator) {
  const stabilizedThis = array.map((el, index) => [el, index]);
  stabilizedThis.sort((a, b) => {
    const order = comparator(a[0], b[0]);
    if (order !== 0) {
      return order;
    }
    return a[1] - b[1];
  });
  return stabilizedThis.map((el) => el[0]);
}

// ==============================|| ORDER TABLE - HEADER CELL ||============================== //

const headCells = [
  {
    id: "userId",
    align: "left",
    disablePadding: false,
    label: "입찰자 ID",
  },
  {
    id: "Bid",
    align: "left",
    disablePadding: true,
    label: "입찰금액(₩)",
  },
  {
    id: "time",
    align: "left",
    disablePadding: false,

    label: "Time",
  },
];

// ==============================|| ORDER TABLE - HEADER ||============================== //

function OrderTableHead({ order, orderBy }) {
  return (
    <TableHead>
      <TableRow>
        {headCells.map((headCell) => (
          <TableCell
            key={headCell.id}
            align={headCell.align}
            padding={headCell.disablePadding ? "none" : "normal"}
            sortDirection={orderBy === headCell.id ? order : false}>
            {headCell.label}
          </TableCell>
        ))}
      </TableRow>
    </TableHead>
  );
}

OrderTableHead.propTypes = {
  order: PropTypes.string,
  orderBy: PropTypes.string,
};

// ==============================|| ORDER TABLE ||============================== //

export default function OrderTable() {
  const [order] = useState("asc");
  const [orderBy] = useState("userId");
  const [selected] = useState([]);

  const isSelected = (userId) => selected.indexOf(userId) !== -1;

  return (
    <Box>
      <TableContainer
        sx={{
          width: "100%",
          overflowX: "auto",
          position: "relative",
          display: "block",
          maxWidth: "100%",
          "& td, & th": { whiteSpace: "nowrap" },
        }}>
        <Table aria-labelledby="tableTitle">
          <OrderTableHead order={order} orderBy={orderBy} />
          <TableBody>
            {stableSort(rows, getComparator(order, orderBy)).map(
              (row, index) => {
                const isItemSelected = isSelected(row.userId);
                const labelId = `enhanced-table-checkbox-${index}`;

                return (
                  <TableRow
                    hover
                    role="checkbox"
                    sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                    aria-checked={isItemSelected}
                    tabIndex={-1}
                    key={row.userId}
                    selected={isItemSelected}>
                    <TableCell
                      component="th"
                      id={labelId}
                      scope="row"
                      align="left">
                      <Link color="secondary" component={RouterLink} to="">
                        {row.userId}
                      </Link>
                    </TableCell>
                    <TableCell align="left">{row.Bid}</TableCell>
                    <TableCell align="left">
                      <OrderStatus status={row.carbs} />
                    </TableCell>
                  </TableRow>
                );
              }
            )}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
}
